import React from "react";
import styled from "styled-components";

const LoginPage = () => {
  let clientScreenHeight = document.documentElement.clientHeight;

  let LoginHead = styled("span")`
    font-size: 48px;
    border-bottom: 2px solid #2d4059;
  `;

  return (
    <div>
      <div className="container">
        <div className="row">
          <div
            className="col d-flex flex-column justify-content-center"
            style={{ height: clientScreenHeight }}
          >
            <p>
              <LoginHead>Login</LoginHead>
            </p>
            <p>ㅎㅎ</p>
            <p>ㅎㅎ</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default LoginPage;
